/**
 * Push a new state.
 *
 * @param {Object} options The new state.
 * @param {Object} data    The data for the new state.
 * @param {String} title   The title for the new state.
 */
export function push(options: any, data: any, title: string): void;
/**
 * Replace a new state.
 *
 * @param {Object} options The new state.
 * @param {Object} data    The data for the new state.
 * @param {String} title   The title for the new state.
 */
export function replace(options: any, data: any, title: string): void;
